(function(e,t){$.getJSON("js/icons.json").done(function(e){$.each(e,function(n){t=t?t+",":"";t+=e[n].id});$.ajax("https://itunes.apple.com/lookup",{cache:!0,dataType:"jsonp",jsonpCallback:"showIcons",data:{id:t}}).done(function(t){$.each(t.results,function(n){$("<div/>").addClass("grid__item icon__wrapper").hide().append('<a href="'+e[n].url+'" class="icon__item">'+'<img alt="'+e[n].name+'" src="'+t.results[n].artworkUrl100+'"></a>').appendTo("#icons").delay(200*n).fadeIn()})})})})();